「いないいないばあっ! 赤ちゃんのおしりふき <br />80枚入×3P」は、ふんわり厚手タイプの不織布でおしりの汚れをきれいにふきとるおしりふきです。<br /><br />ノンアルコール・無香料ですので、赤ちゃんのお肌にも安心してお使いいただけます。<br /><br /><br />モモ葉エキス配合で、赤ちゃんのお肌に潤いをあたえます。<br /><br /><br /><br />使用方法<br /><br />(1)表面のフタシールをOPENより開け、シートを1枚ずつ取り出してください。<br /><br />(2)清潔な手でシートを取り出し、やさしく肌を拭いてください。シートは両面使えます。<br /><br />使用上の注意<br /><br /><br />●用途以外には使用しないでください。<br />●シートの乾燥を防ぐため、使用後はフタシールをきちんと閉めてください。<br /><br />●開封後は、なるべく早めにお使いください。<br />●お肌に傷やはれもの、湿疹等の異常がある時は使用しないでください。<br /><br />●お肌に異常が発生した場合や、お肌に合わない場合は、ご使用をおやめください。<br />●一度使用したシートは、再度使用しないでください。<br /><br />●高温・多湿、直射日光を避けて保管してください。<br />●乳幼児の手の届かない所に保管してください。(誤飲・誤食にご注意ください。)<br /><br />●内容成分(原材料)のにおいが感じられる場合がありますが、品質には問題ありません。<br />●シートは水には溶けませんので、トイレ等に流さないでください。<br /><br /><br />品質表示<br /><br />●成分：水、プロピレングリコール、セチルピリジニウムクロリド、エチルパラベン、メチルパラベン、モモ葉エキス<br /><br />●材質：レーヨン不織布(日本製)<br /><br />原産国<br /><br />日本<br /><br />お問い合わせ先<br /><br />昭和紙工株式会社 お客様相談室<br /><br />フリーダイヤル：0120-127738<br />受付時間 9：00-17：00(土、日、祝日を除く)<br /><br /><br /><br />（ウエットティッシュ　おしりふき　おてふき　ティッシュ　ティシュー　赤ちゃん　baby　子ども　ベビー　こども　子供　幼児　乳児　ママ　育児　子育て　清潔　お手拭き　ウェットティシュー　いないいないばあ　イナイイナイバア　いないいないばー　いないいないばぁ）<br /><br /><br />JANコード：4957434005223<br />商品番号：101-31309<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
